(0, 183, 67, 0, NULL, '<?xml version="1.0" encoding="utf-8"?>\n<ezauthor><authors><author id="0" name="Roland Benedetti" email="Roland.Benedetti@ez.no"/></authors></ezauthor>\n', 'ezauthor', 266, 'fre-FR', 2, 0, '', 1),
(0, 184, 67, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>If Create, Deliver and Optimize is the winning formula, the last thing you want to do when you are there is to automate so that your online user experience is self-building!</paragraph></section>', 'ezxmltext', 267, 'fre-FR', 2, 0, '', 1),
(0, 185, 67, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>Identifying the right content, picking delivery strategy, understanding your metrics and optimizing your online presence to have your numbers on the up-side are tasks that requires a lot of work that no machine could do by itself. However, when you have identified the right recipes in that Create - Deliver - Optimize cycle, the next thing you want to do is automate as much as possible all the recurring tasks. That is where a platform like the eZ Publish Platform will deliver even more value, from Content sourcing and authoring to delivery workflow and marketing automation, relying on an integrated platform will help you automate the tasks that are taking your KPIs and your online business up!</paragraph></section>', 'ezxmltext', 268, 'fre-FR', 2, 0, '', 1),
