(0, 184, 69, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>Increasing the productivity of your content infrastructure, eZ Publish Enterprise provides you with powerful tools to create, automate and collaborate on content...</paragraph></section>', 'ezxmltext', 289, 'fre-FR', 2, 0, '', 1),
(0, 185, 69, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>Dealing with hundreds of editors, having millions of content contributions from different sources and managing information with dozens of audiences can get complex. You get a single tool to create content whatever the content type is. From very simple and unstructured to highly structured content with complex metadata and rich media. eZ Publish Enterprise enables your non-technical contributors to manage complex content infrastructures and to collaborate with co-workers to get tasks done quickly.</paragraph></section>', 'ezxmltext', 290, 'fre-FR', 2, 0, '', 1),
