(0, 184, 70, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>It’s about the right content at the right time and in the right format!</paragraph></section>', 'ezxmltext', 300, 'fre-FR', 2, 0, '', 1),
(0, 185, 70, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>eZ Publish Enterprise offers an entire set of capabilities including search, analytics, personalized recommendations as well as automated and integrated testing functionality (e.g. A/B, Multivariate, etc.). Efficient search starts with enabling editors and letting them search for existing content to reuse and re-purpose. You can analyze the user behaviour, create a compelling content strategy and provide automated scenarios based on the users'' behaviour.</paragraph></section>', 'ezxmltext', 301, 'fre-FR', 2, 0, '', 1),
