(0, 184, 71, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph><line xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Welcome to eZ Publish Platform 5.3, the Ventoux release. </line><line xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">This release brings several new features and general improvements on the foundations introduced in eZ Publish Platform 5</line></paragraph></section>', 'ezxmltext', 311, 'fre-FR', 2, 0, '', 1),
(0, 185, 71, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><section><header>Key Selected New Features in eZ Publish 5</header><paragraph>Our objective is to provide you the most compelling Multichannel Web and Customer Experience Platform. With the eZ Publish 5 architecture we encompass a thoroughly revamped platform, which facilitates better user experiences, increases productivity, and enables your digital business model sustainably. Underlying and enabling these ambitious goals is a completely new but thoroughly backward compatible product architecture, along with a host of user interface (UI) enhancements.</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">New Public API – Streamlined PHP Interface to eZ Publish</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Enhanced REST API – eZ Publish as a Web Service</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">New high-performance framework for Web projects – Symfony full stack</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">New modern template engine – Twig based</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Still totally backward compatible with 4.x legacy architecture</paragraph></li></ul></paragraph><paragraph>For further information visit <link url_id="8">www.ez.no,</link> the documentation: <link url_id="25">doc.ez.no</link> and the <link url_id="24">share.ez.no</link> community.</paragraph></section></section>', 'ezxmltext', 312, 'fre-FR', 2, 0, '', 1),
(0, 186, 71, 0, NULL, '<?xml version="1.0" encoding="utf-8"?>\n<ezimage serial_number="1" is_valid="1" filename="Getting-Started-with-eZ-Publish-Platform.jpg" suffix="jpg" basename="Getting-Started-with-eZ-Publish-Platform" dirpath="var/ezdemo_site/storage/images/getting-started/selected-features/getting-started-with-ez-publish-platform/313-1-fre-FR" url="var/ezdemo_site/storage/images/getting-started/selected-features/getting-started-with-ez-publish-platform/313-1-fre-FR/Getting-Started-with-eZ-Publish-Platform.jpg" original_filename="1f96ad5f.jpg" mime_type="image/jpeg" width="780" height="383" alternative_text="" alias_key="1293033771" timestamp="1463821126"><original attribute_id="313" attribute_version="1" attribute_language="fre-FR"/><information Height="383" Width="780" IsColor="1"/></ezimage>\n', 'ezimage', 313, 'fre-FR', 2, 0, '', 1),
