(0, 212, 74, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>Protect your iPhone 4 with a customizable iPhone 4 case.</paragraph></section>', 'ezxmltext', 328, 'fre-FR', 2, 0, '', 1),
(0, 213, 74, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>Made of lightweight hard shell plastic, this case protects the back and sides of your iPhone 4 without adding bulk. Made with a matte finish, your designs, photos, and text will look great displayed on this one of a kind case.</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Designed for Apple’s iPhone 4.</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Hard shell plastic case with matte finish.</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Access to all ports, controls &amp; sensors.</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Customize with photos, artwork and text.</paragraph></li></ul></paragraph></section>', 'ezxmltext', 329, 'fre-FR', 2, 0, '', 1),
