(0, 212, 75, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>Pump up your Galaxy S3 with the customizable Case-Mate Vibe case from Zazzle.</paragraph></section>', 'ezxmltext', 338, 'fre-FR', 2, 0, '', 1),
(0, 213, 75, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>Contoured perfectly to fit the Galaxy S3, this case features a hard shell plastic exterior and shock absorbing liner to protect your device from daily wear and tear. Sleek and lightweight, this case is the perfect way to share your custom style with the world.</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Impact resistant &amp; lightweight hard plastic case with rubber lined interior.</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Designed for the Samsung Galaxy S3 (AT&amp;T, Verizon, T-Mobile, and Sprint models).</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Printed in the USA.</paragraph></li></ul></paragraph></section>', 'ezxmltext', 339, 'fre-FR', 2, 0, '', 1),
