(0, 213, 76, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>A truly unique mug. When it’s cold, it’s just a simple black mug. When you add any hot beverage (water, tea, coffee, etc.), your mug turns white and the image comes to life in vibrant colors. 11 oz. Hand wash only. Imported.</paragraph></section>', 'ezxmltext', 349, 'fre-FR', 2, 0, '', 1),
