(0, 213, 77, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>This best-selling California Fleece track jacket by American Apparel is extra thick for added warmth, yet it''s breathable. Stay comfortable while walking, jogging, or hanging out outside with this jacket made of 100% extra soft ringspun combed cotton. Featuring contrast white piping and zipper, you''ll look and feel vibrant when wearing this to all of your favorite activities.</paragraph></section>', 'ezxmltext', 359, 'fre-FR', 2, 0, '', 1),
