(0, 184, 79, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>Product Support is the core service of the eZ Publish Enterprise subscription, available to all our customers, with differing initial response times depending on the subscription service level. Subscribing to eZ Publish Enterprise gives you the option of requesting assistance from our product support team.</paragraph></section>', 'ezxmltext', 374, 'fre-FR', 2, 0, '', 1),
(0, 185, 79, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><section><header>Dedicated, Responsive and Efficient</header><paragraph>Product Support is the core service of the eZ Publish Enterprise subscription, available to all our customers, with differing initial response times depending on the subscription service level.</paragraph><section><header>Unlimited Product Support</header><paragraph>In addition to the available documentation and books, Enterprise subscribers have access to a highly professional support service which provides 3 tiers of support, escalation processes and both online and phone access. Our highly qualified, experienced product support teams are dedicated to the success of our customers. They ensure that your projects are successful and that you are totally satisfied with eZ. eZ is dedicated to helping and supporting both clients and partners. This is the core service of eZ''s Enterprise Open Source Business model.</paragraph></section><section><header>Access to extended solution support</header><paragraph>In addition to maintenance, you may want assistance from our professional services team to help manage your platform or assist with eZ Publish-based application development. With eZ Publish Enterprise, you are free to include extended services from our professional services staff. They are on-hand to help you implement and run your platform. Services differ depending on your region. They can include solution support tickets, regular audits, technical key accounting or training services.</paragraph><paragraph>No single solution is right for everyone, and just as one size does not fit all, you will discuss extended solution support with our sales engineer to define the specific package that fits your needs!</paragraph><paragraph>In the event that you need a one-time intervention, you have the flexibility to order specific professional services in addition to your service subscription at a moment’s notice.</paragraph></section></section><section><header>Keep Your Platform Secure and Up-to-Date</header><paragraph>Subscribing to eZ Publish Enterprise gives you the option of requesting assistance from our product support team.</paragraph><section><header>eZ Publish Enterprise maintenance</header><paragraph>Subscribing to eZ Publish Enterprise gives you the option of requesting assistance from our product support team. In addition, eZ is constantly actively maintaining and assuring the quality of our software. With an eZ Publish Enterprise subscription, your installation will benefit from our quality assurance programs, which feature service packs to fix issues identified in the software as well as improve or enhance it in a variety of ways. eZ Publish Enterprise subscription is the best option for ensuring your eZ Publish platform is stable, reliable and continuously supported by our support services.</paragraph></section><section><header>eZ Publish bug fix guarantee</header><paragraph>By subscribing to eZ Publish Enterprise, you benefit from an unique bug fix guarantee that cannot be obtained in any other way. eZ, as the maker of eZ Publish, deploys the necessary resources in order to fix the bugs you identify via the maintenance service.</paragraph><paragraph>If need be, and depending of the service level of your subscription, eZ will provide hot fixes - a rapid-response measure to workaround issues before the fix is even available in the maintenance service.</paragraph></section></section></section>', 'ezxmltext', 375, 'fre-FR', 2, 0, '', 1),
