(0, 184, 80, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>eZ offers Expert Consulting and Audits via our Professional Services to help keep your eZ websites on-time, on-track and performing at peak levels. Our goal is that your implementation succeeds and that you get your message out on-time and on-budget.</paragraph></section>', 'ezxmltext', 385, 'fre-FR', 2, 0, '', 1),
(0, 185, 80, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>eZ offers professional services to assist partners and/or clients with unusually complex situations that require specific project assistance. The scope is determined and customized prior to the time of engagement. Work can be performed remotely or on the client premises according to project needs.</paragraph></section>', 'ezxmltext', 386, 'fre-FR', 2, 0, '', 1),
