enhance training business and opens doors to the eZ''s ecosystem of partners and customers, wh...</paragraph><paragraph><link url_id="51">more »</link></paragraph></section></section><section><section><header><link url_id="52">Online Certification</link></header><paragraph>Most trainings are combined with the option of an online certification. eZ systems offers to perform an online exam with an automated tool.</paragraph></section></section></section>', 'ezxmltext', 397, 'fre-FR', 2, 0, '', 1),
