(0, 199, 92, 0, NULL, 'Discover eZ Publish 5', 'ezstring', 456, 'fre-FR', 2, 0, 'discover ez publish 5', 1),
(0, 200, 92, 0, 1045487555, '<?xml version="1.0"?>\n<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph><embed size="medium" view="embed" align="right" custom:offset="0" custom:limit="5" object_id="94"/><strong>Mont Ventoux</strong>&#xA0;(<emphasize>Ventor</emphasize>&#xA0;in Proven&#xE7;al) is a mountain in the&#xA0;Provence&#xA0;region of southern&#xA0;France, located some 20&#xA0;km northeast of&#xA0;Carpentras,&#xA0;Vaucluse. On the north side, the mountain borders the&#xA0;Dr&#xF4;me&#xA0;<emphasize>d&#xE9;partement</emphasize>. It is the largest mountain in the region and has been nicknamed the "Beast of Provence",&#xA0;the "Giant of Provence",&#xA0;or "The Bald Mountain".&#xA0;It has gained fame through its use in the&#xA0;Tour de France&#xA0;cycling race.</paragraph><section><section><header>White Papers</header><paragraph>Download our white paper if you want to quickly discover eZ Publish 5.</paragraph><paragraph>This white paper contains</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><strong>A detailed presentation of eZ Publish 5 for Marketers and Editors.</strong></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><strong>An introduction to the eZ Publish 5 technical architecture.</strong></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><strong>A clear summary of the value of using such a digital user experience management platform.</strong></paragraph></li></ul></paragraph><paragraph>Don''t hesitate, leave us your contact information and download this paper to get all the benefits of eZ Publish 5.</paragraph></section></section></section>\n', 'ezxmltext', 457, 'fre-FR', 2, 0, '', 1),
