(0, 185, 93, 0, 1045487555, '<?xml version="1.0"?>\n<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>Beyond Content Management, managing &#x201C;Digital Experiences&#x201D;, takes much more than technology; it is a strategy that focuses on the operations and processes of a business around the needs of the individual customer. Today leading organizations are increasingly focusing on building great experiences but realize it is a complex enterprise, involving strategy, integration of technology, orchestrating business models, brand management and CEO commitment.&#xA0;</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><embed view="embed" size="medium" custom:offset="0" custom:limit="5" object_id="96"/></paragraph></section>\n', 'ezxmltext', 469, 'fre-FR', 2, 0, '', 1),
