(0, 245, 99, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>The Matterhorn, also known as Cervino was the second mountain codename used, it was in spring 2011 for the eZ Publish 4.5 release. Photo: ccl <link url_id="54">Some rights reserved</link> by <link url_id="55">Frank Peters</link></paragraph></section>', 'ezxmltext', 506, 'fre-FR', 2, 0, '', 1),
