(0, 286, 110, 0, NULL, 'Mount Matterhorn', 'ezstring', 558, 'fre-FR', 2, 0, 'mount matterhorn', 1),
(0, 287, 110, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>The <strong>Matterhorn</strong> (German), <strong>Monte Cervino</strong> (Italian) or <strong>Mont Cervin</strong> (French), is a mountain in the Pennine Alps on the border between Switzerland and Italy. Its summit is 4,478 metres (14,692 ft) high, making it one of the highest peaks in the Alps. The four steep faces, rising above the surrounding glaciers, face the four compass points. The mountain overlooks the town of Zermatt in the canton of Valais to the north-east and Breuil-Cervinia in the Aosta Valley to the south. Theodul Pass, located at the eastern base of the peak, is the lowest passage between its north and south side.</paragraph><paragraph><custom name="sub">This article uses material from the Wikipedia article <link target="_blank" url_id="60">Matterhorn</link>, which is released under the <link target="_blank" url_id="59">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>', 'ezxmltext', 559, 'fre-FR', 2, 0, '', 1),
(0, 288, 110, 0, NULL, '<?xml version="1.0" encoding="utf-8"?>\n<ezimage serial_number="1" is_valid="1" filename="Mount-Matterhorn.jpg" suffix="jpg" basename="Mount-Matterhorn" dirpath="var/ezdemo_site/storage/images/ez-mountains/mount-matterhorn/560-1-fre-FR" url="var/ezdemo_site/storage/images/ez-mountains/mount-matterhorn/560-1-fre-FR/Mount-Matterhorn.jpg" original_filename="7df85099.jpg" mime_type="image/jpeg" width="770" height="578" alternative_text="" alias_key="1293033771" timestamp="1463821139"><original attribute_id="560" attribute_version="1" attribute_language="fre-FR"/><information Height="578" Width="770" IsColor="1" ByteOrderMotorola="0"/></ezimage>\n', 'ezimage', 560, 'fre-FR', 2, 0, '', 1),
