(0, 286, 111, 0, NULL, 'Mount Annapurna', 'ezstring', 564, 'fre-FR', 2, 0, 'mount annapurna', 1),
(0, 287, 111, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph><strong>Annapurna</strong> (Sanskrit, Nepali, Nepal Bhasa: अन्नपुर्ण) is a section of the Himalayas in north-central Nepal that includes 8,091 m (26,545 ft) Annapurna I, thirteen additional peaks over 7,000 m (22,970 ft) and 16 more over 6,000 m (19,690 ft). This section is a 55 km-long (34 mi-long) massif bounded by the Kali Gandaki Gorge on the west, the Marshyangdi River on the north and east, and Pokhara Valley on the south. Annapurna I is tenth among Earth''s fourteen <emphasize>eight-thousanders</emphasize>. 8167 metre Dhaulagiri I rises 34 km to the west across the Kali Gandaki Gorge, considered Earth''s deepest canyon.</paragraph><paragraph><custom name="sub">This article uses material from the Wikipedia article <link target="_blank" url_id="61">Annapurna</link>, which is released under the <link target="_blank" url_id="59">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>', 'ezxmltext', 565, 'fre-FR', 2, 0, '', 1),
(0, 288, 111, 0, NULL, '<?xml version="1.0" encoding="utf-8"?>\n<ezimage serial_number="1" is_valid="1" filename="Mount-Annapurna.jpg" suffix="jpg" basename="Mount-Annapurna" dirpath="var/ezdemo_site/storage/images/ez-mountains/mount-annapurna/566-1-fre-FR" url="var/ezdemo_site/storage/images/ez-mountains/mount-annapurna/566-1-fre-FR/Mount-Annapurna.jpg" original_filename="553bfea2.jpg" mime_type="image/jpeg" width="770" height="578" alternative_text="" alias_key="1293033771" timestamp="1463821139"><original attribute_id="566" attribute_version="1" attribute_language="fre-FR"/><information Height="578" Width="770" IsColor="1"/></ezimage>\n', 'ezimage', 566, 'fre-FR', 2, 0, '', 1),
