(0, 287, 112, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph><strong>Mount Etna</strong> (Latin: <emphasize>Aetna</emphasize>, Sicilian: <emphasize>Mungibeddu</emphasize> or <emphasize>''a Muntagna</emphasize>) is an active stratovolcano on the east coast of Sicily, Italy, close to Messina and Catania. It lies above the convergent plate margin between the African Plate and the Eurasian Plate. It is the tallest active volcano on the European continent, currently 3,329 m (10,922 ft) high, though this varies with summit eruptions. It is the highest mountain in Italy south of the Alps. Etna covers an area of 1,190 km<custom name="sup">2</custom> (459 sq mi) with a basal circumference of 140 km. This makes it by far the largest of the three active volcanoes in Italy, being about two and a half times the height of the next largest, Mount Vesuvius. Only Mount Teide in Tenerife surpasses it in the whole of the European–North-African region. In Greek Mythology, the deadly monster Typhon was trapped under this mountain by Zeus, the god of the sky and thunder and king of gods, and the forges of Hephaestus were said to also be located underneath it.</paragraph><paragraph><custom name="sub">This article uses material from the Wikipedia article <link target="_blank" url_id="62">Mount Etna</link>, which is released under the <link target="_blank" url_id="59">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>', 'ezxmltext', 571, 'fre-FR', 2, 0, '', 1);
