(0, 286, 114, 0, NULL, 'Mount Stadda', 'ezstring', 582, 'fre-FR', 2, 0, 'mount stadda', 1),
(0, 287, 114, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph><strong>Stadda </strong>(in Lule Sami: <emphasize>Stádda</emphasize>) is a mountain in the municipality of Tysfjord in Nordland county, Norway. It is located about 15 kilometres (9 mi) northeast of the village of Kjøpsvik. The mountain has very smooth sides reaching all the way to the fjord. Stetind has an obelisk-shape which gives it a very distinct look. In 2002 it was voted to be the "National Mountain" of Norway by listeners of NRK.</paragraph><paragraph><custom name="sub">This article uses material from the Wikipedia article <link target="_blank" url_id="64">Mount Stetind</link>, which is released under the <link target="_blank" url_id="59">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>', 'ezxmltext', 583, 'fre-FR', 2, 0, '', 1),
