(0, 287, 116, 0, 1045487555, '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph><strong>Mont Ventoux</strong> (<emphasize>Ventor</emphasize> in Provençal) is a mountain in the Provence region of southern France, located some 20 km northeast of Carpentras, Vaucluse. On the north side, the mountain borders the Drôme <emphasize>département</emphasize>. It is the largest mountain in the region and has been nicknamed the "Beast of Provence", the "Giant of Provence", or "The Bald Mountain". It has gained fame through its use in the Tour de France cycling race.</paragraph><paragraph><custom name="sub">This article uses material from the Wikipedia article <link target="_blank" url_id="66">Mount Ventoux</link>, which is released under the <link target="_blank" url_id="59">Creative Commons Attribution-ShareAlike License</link>.</custom></paragraph></section>', 'ezxmltext', 595, 'fre-FR', 2, 0, '', 1),
